import React from "react";

const SizePrice = () => {
  return (
    <div className={`order order-wrapper`}>
      <a href="https://bols.com/cocktails/recipes">
        <div className={`textParallax`}>
          <div className="textBox">
            <div className="title">
              <p className="textHeader">
                {"Frappu "}
                {"Choco"}
              </p>
              <span className="textPrice">{"29k"}</span>
            </div>
            <div className="sizes">
              <button className="sizeButton thin">M</button>
              <button className="sizeButton hablfett">L</button>
              <button className="sizeButton fett">XL</button>
            </div>
          </div>
        </div>
      </a>
    </div>
  );
};

export default SizePrice;
